const Standings = ({url, leagueId}) => {
    const [stages, setStages] = useState([])

    useEffect(() => {
        fetch(`url/standings?leagueId=${leagueId}`)
            .then(response => response.json())
            .then(result => setStages(result.stages))
    }, [url, leagueId])

    return(
        <div>
            {stages.map(stage => (
                <div>test</div>
            ))}
        </div>
    )
}

export default Standings
